import React, { useState, useEffect } from 'react';
import axios from 'axios';

const FinancialGuide = () => {
    const [guide, setGuide] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        fetchFinancialGuide();
    }, []);

    const fetchFinancialGuide = async () => {
        try {
            setLoading(true);
            const response = await axios.get('http://localhost:5000/api/financial-guide');
            setGuide(response.data);
            setError(null);
        } catch (err) {
            setError('Failed to fetch financial guide');
            console.error('Error fetching financial guide:', err);
        } finally {
            setLoading(false);
        }
    };

    if (loading) return <div className="loading">Generating your personalized financial guide...</div>;
    if (error) return <div className="error-message">{error}</div>;
    if (!guide) return null;

    return (
        <div className="financial-guide-section">
            <div className="financial-guide-header">
                <h3>Your AI Financial Guide</h3>
                <p className="overview">{guide.overview}</p>
            </div>

            <div className="cards-grid">
                {/* Recommendations */}
                <div className="ai-insights-card">
                    <div className="ai-insights-header">
                        <h4>💡 Smart Recommendations</h4>
                    </div>
                    <div className="ai-insights-content">
                        {guide.recommendations.map((rec, index) => (
                            <div 
                                key={index} 
                                className="ai-tip"
                                data-type={rec.type}
                                data-priority={rec.priority}
                                style={{animationDelay: `${index * 0.1}s`}}
                            >
                                <div className="ai-tip-icon">
                                    {rec.type === 'saving' && '💰'}
                                    {rec.type === 'warning' && '⚠️'}
                                    {rec.type === 'trend' && '📈'}
                                    {rec.type === 'suggestion' && '💡'}
                                    {rec.type === 'achievement' && '🎯'}
                                </div>
                                <div className="ai-tip-content">
                                    <div className="ai-tip-title">{rec.title}</div>
                                    <div className="ai-tip-description">{rec.description}</div>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>

                {/* Budgeting Tips */}
                <div className="ai-insights-card">
                    <div className="ai-insights-header">
                        <h4>📊 Category-Specific Tips</h4>
                    </div>
                    <div className="ai-insights-content">
                        {guide.budgetingTips.map((tip, index) => (
                            <div 
                                key={index} 
                                className="ai-tip"
                                style={{animationDelay: `${index * 0.1}s`}}
                            >
                                <div className="ai-tip-icon">💼</div>
                                <div className="ai-tip-content">
                                    <div className="ai-tip-title">{tip.category}</div>
                                    <div className="ai-tip-description">{tip.tip}</div>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>

                {/* Saving Opportunities */}
                <div className="ai-insights-card">
                    <div className="ai-insights-header">
                        <h4>💫 Saving Opportunities</h4>
                    </div>
                    <div className="ai-insights-content">
                        {guide.savingOpportunities.map((opp, index) => (
                            <div 
                                key={index} 
                                className="ai-tip"
                                style={{animationDelay: `${index * 0.1}s`}}
                            >
                                <div className="ai-tip-icon">✨</div>
                                <div className="ai-tip-content">
                                    <div className="ai-tip-title">
                                        Potential Saving: ₹{opp.potentialSaving}
                                    </div>
                                    <div className="ai-tip-description">{opp.description}</div>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default FinancialGuide;
